import React, { Component } from 'react'
import NavBar from '../Components/NavBar.jsx';


export default class MainPage extends Component {
	render() {
		return (
			<Router>
			<Routes>
				<Route path="/" element={<NavBar />} />
			</Routes>
		</Router>
		)
	}
}
